import React from "react";
import {BrowserRouter as Router, Link, Route} from "react-router-dom";
import HomePage from "./pages/HomePage";
import Login from "./pages/Login";
import Browse from "./pages/Browse";

function App() {
  const [emailAddress, setEmailAddress] = React.useState("");

  function getEmail(newAddress){
    setEmailAddress(newAddress);
  }

    return(
      <Router>
        {/* <Route path="/" children={() => (<HomePage setEmail={getEmail} />)} />
        <Route path="/login" children={() => <Login emailAddress={emailAddress} />} /> */}
        {/* <Route path="/browse" children={() => <Browse/>} /> */}
        <ul>
          <ListItemLink to="/" children={<HomePage setEmail={getEmail} />} />
          <ListItemLink to="/login"/>
        </ul>
      </Router>
    );

    function ListItemLink({ to, ...rest}){
      return(
        <Route
          path={to}
          children={(match) => {
            return(
              <li className={match ? "active" : ""}>
                <Link to={to} {...rest} />
              </li>
            );
          }}
        />
      );
    }
}

export default App;
